import assert from 'node:assert';
import test, { describe, it } from 'node:test';
import { setTimeout } from 'node:timers/promises';
import { HealthStatus, Medicus } from '../src';

describe('Medicus', () => {
  it('returns healthy when no checkers are added', async () => {
    using medicus = new Medicus({});

    const result = await medicus.performCheck();

    assert.deepStrictEqual(result, {
      status: HealthStatus.HEALTHY,
      services: {}
    });
  });

  it('registers multiple checkers', async () => {
    using medicus = new Medicus({});

    medicus.addChecker({
      firstChecker() {
        return HealthStatus.HEALTHY;
      },
      secondChecker() {
        return HealthStatus.UNHEALTHY;
      }
    });

    const result = await medicus.performCheck();

    assert.deepStrictEqual(result, {
      status: HealthStatus.UNHEALTHY,
      services: {
        firstChecker: {
          status: HealthStatus.HEALTHY
        },
        secondChecker: {
          status: HealthStatus.UNHEALTHY
        }
      }
    });
  });

  it('returns unhealthy when a checker fails', async () => {
    using medicus = new Medicus({
      checkers: {
        alwaysFails() {
          return HealthStatus.UNHEALTHY;
        }
      }
    });

    const result = await medicus.performCheck();

    assert.deepStrictEqual(result, {
      status: HealthStatus.UNHEALTHY,
      services: {
        alwaysFails: {
          status: HealthStatus.UNHEALTHY
        }
      }
    });
  });

  it('supports all kinds of returns', async () => {
    const createdError = new Error('Promise void error');

    using medicus = new Medicus({
      checkers: {
        returnsEnum() {
          return HealthStatus.DEGRADED;
        },
        returnsDetailed() {
          return {
            status: HealthStatus.HEALTHY,
            debug: {
              debugProperty: 'debugValue'
            }
          };
        },
        returnsVoid() {},
        async returnsPromiseEnum() {
          return HealthStatus.HEALTHY;
        },
        async returnsPromiseDetailed() {
          return {
            status: HealthStatus.DEGRADED,
            debug: {
              debugAsyncProperty: 'debugAsyncValue'
            }
          };
        },
        async returnsPromiseVoid() {},
        async rejectsPromiseVoid() {
          throw createdError;
        }
      }
    });

    const result = await medicus.performCheck();

    assert.deepStrictEqual(result, {
      status: HealthStatus.UNHEALTHY,
      services: {
        returnsEnum: {
          status: HealthStatus.DEGRADED
        },
        returnsDetailed: {
          status: HealthStatus.HEALTHY,
          debug: {
            debugProperty: 'debugValue'
          }
        },
        returnsVoid: {
          status: HealthStatus.HEALTHY
        },
        returnsPromiseEnum: {
          status: HealthStatus.HEALTHY
        },
        returnsPromiseDetailed: {
          status: HealthStatus.DEGRADED,
          debug: {
            debugAsyncProperty: 'debugAsyncValue'
          }
        },
        returnsPromiseVoid: {
          status: HealthStatus.HEALTHY
        },
        rejectsPromiseVoid: {
          status: HealthStatus.UNHEALTHY,
          debug: { error: createdError }
        }
      }
    });
  });

  it('throws on adding two checkers with the same name', () => {
    using medicus = new Medicus();

    medicus.addChecker({ checker() {} });

    assert.throws(() => {
      medicus.addChecker({ checker() {} });
    });
  });

  test('removes a checker at runtime', async (t) => {
    await t.test('by reference', async () => {
      using medicus = new Medicus();

      function checker() {
        return HealthStatus.HEALTHY;
      }

      medicus.addChecker({ checker });

      let result = await medicus.performCheck();

      assert.deepStrictEqual(result, {
        status: HealthStatus.HEALTHY,
        services: {
          checker: {
            status: HealthStatus.HEALTHY
          }
        }
      });

      medicus.removeChecker(checker);

      result = await medicus.performCheck();

      assert.deepStrictEqual(result, {
        status: HealthStatus.HEALTHY,
        services: {}
      });
    });

    await t.test('by name', async () => {
      using medicus = new Medicus();

      medicus.addChecker({
        checker() {
          return HealthStatus.HEALTHY;
        }
      });

      let result = await medicus.performCheck();

      assert.deepStrictEqual(result, {
        status: HealthStatus.HEALTHY,
        services: {
          checker: {
            status: HealthStatus.HEALTHY
          }
        }
      });

      medicus.removeChecker('checker');

      result = await medicus.performCheck();

      assert.deepStrictEqual(result, {
        status: HealthStatus.HEALTHY,
        services: {}
      });
    });
  });

  it('returns lastCheck()', async () => {
    using medicus = new Medicus();

    assert.deepStrictEqual(medicus.getLastCheck(), null);

    const firstCheck = await medicus.performCheck();

    assert.deepStrictEqual(medicus.getLastCheck(), firstCheck);

    const secondCheck = await medicus.performCheck();

    assert.deepStrictEqual(medicus.getLastCheck(), secondCheck);
  });

  it('logs when an error happens', async () => {
    let loggedError: any = null;

    using medicus = new Medicus({
      checkers: {
        alwaysFails() {
          throw new Error('This is an error');
        }
      },
      errorLogger: (error, checkerName) => {
        loggedError = { error, checkerName };
      }
    });

    await medicus.performCheck();

    assert(loggedError !== null);
    assert(loggedError.error instanceof Error);
    assert.strictEqual(loggedError.checkerName, 'alwaysFails');
  });

  it('runs checks in the background', async () => {
    using medicus = new Medicus({
      checkers: { success() {} },
      backgroundCheckInterval: 10,
      manualClearBackgroundCheck: true
    });

    assert.equal(medicus.getLastCheck(), null);

    await setTimeout(20);

    assert.deepStrictEqual(medicus.getLastCheck(), {
      status: HealthStatus.HEALTHY,
      services: {
        success: {
          status: HealthStatus.HEALTHY
        }
      }
    });
  });
});

export * from './types';
export * from './medicus';
export * as Schemas from './schemas';

import type { Medicus } from './medicus';

export enum HealthStatus {
  HEALTHY = 'healthy',
  DEGRADED = 'degraded',
  UNHEALTHY = 'unhealthy'
}

export interface DetailedHealthCheck {
  /**
   * The status of the health check
   */
  status: HealthStatus;

  /**
   * A list of key-value pairs with additional information about the health check
   * to be shown in the debug output
   */
  debug?: Record<string, number | boolean | string>;
}

export interface HealthCheckResult {
  /**
   * The status of the health check
   */
  status: HealthStatus;

  /**
   * A per service breakdown of the health check results
   */
  services: Record<string, DetailedHealthCheck>;
}

/**
 * A health check function that can be used to check if a part of the system is healthy
 */
export interface HealthChecker<C> {
  (
    this: void,
    ctx: C
  ):
    | void
    | HealthStatus
    | DetailedHealthCheck
    | Promise<void>
    | Promise<HealthStatus>
    | Promise<DetailedHealthCheck>;

  /** The (sub)service name this checks for */
  name: string;
}

export interface MedicusOption<C> {
  /**
   * List of checkers to automatically add to the medicus instance
   */
  checkers?: Record<string, HealthChecker<C>>;

  /**
   * Context for the checkers to be executed in
   */
  context?: C

  /**
   * If provided, this function will be called whenever an error occurs during the execution of a health check
   */
  errorLogger?: (error: unknown, checkerName: string) => void;

  /**
   * By default {@linkcode Medicus.performCheck} needs to be called manually to perform a health check.
   *
   * If set to true, the health check will be performed automatically in the background at the specified interval.
   *
   * @default null
   */
  backgroundCheckInterval?: number;

  /**
   * If set to true, {@linkcode Medicus.closeBackgroundCheck} should be manually called to stop the background check.
   *
   * @default false
   */
  manualClearBackgroundCheck?: boolean;
}

import closeWithGrace from 'close-with-grace';
import {
  type DetailedHealthCheck,
  type HealthCheckResult,
  type HealthChecker,
  HealthStatus,
  type MedicusOption
} from './types';

/**
 * A class that can be used to perform health checks on a system
 */
export class Medicus<C = void> {
  private checkers: Map<string, HealthChecker<C>> = new Map();
  private lastCheck: HealthCheckResult | null = null;

  /**
   * The interval id of the background check if it's running
   */
  private backgroundCheckIntervalId: NodeJS.Timeout | null = null;

  /** Context used for the checkers */
  public context: C;

  constructor(private readonly options: MedicusOption<C> = {}) {
    if (this.options.checkers) {
      this.addChecker(this.options.checkers);
    }

    this.context = this.options.context ?? (undefined as C);

    this.#handleBackgroundCheck();
  }

  /**
   * Adds a new checker to be executed when the health check is run
   */
  addChecker(checkers: Record<string, HealthChecker<C>>): void {
    for (const name in checkers) {
      if (this.checkers.has(name)) {
        throw new Error(`A checker with the name "${name}" is already registered`);
      }

      this.checkers.set(name, checkers[name]!);
    }
  }

  /**
   * Returns an read-only iterator of all the checkers
   */
  listCheckers(): MapIterator<HealthChecker<C>> {
    return this.checkers.values();
  }

  /**
   * Removes a checker from the list of checkers to be executed
   */
  removeChecker(...checkerOrNames: (HealthChecker<C> | string)[]): void {
    for (const checker of checkerOrNames) {
      this.checkers.delete(typeof checker === 'function' ? checker.name : checker);
    }
  }

  /**
   * Returns the last health check result
   */
  getLastCheck(): HealthCheckResult | null {
    return this.lastCheck;
  }

  /**
   * Performs a health check and returns the result
   */
  performCheck = async (): Promise<HealthCheckResult> => {
    let status = HealthStatus.HEALTHY;
    const services: Record<string, DetailedHealthCheck> = {};

    for await (const [serviceName, result] of this.#runChecks()) {
      if (result.status === HealthStatus.UNHEALTHY) {
        status = HealthStatus.UNHEALTHY;
      }

      services[serviceName] = result;
    }

    // updates the last check result
    this.lastCheck = {
      status,
      services
    };

    return this.lastCheck;
  };

  /**
   * Returns a generator that runs all the health checks and yields the results
   */
  async *#runChecks() {
    for (const [name, checker] of this.checkers) {
      yield this.#executeChecker(checker).then((res) => [name, res] as const);
    }
  }

  /**
   * Runs a single health check and returns the result
   *
   * **This function never throws**
   */
  async #executeChecker(checker: HealthChecker<C>): Promise<DetailedHealthCheck> {
    try {
      const check = await checker(this.context);

      switch (typeof check) {
        case 'string':
          return { status: check };
        case 'object':
          return check;
        default:
          return { status: HealthStatus.HEALTHY };
      }
    } catch (error: any) {
      if (this.options.errorLogger) {
        this.options.errorLogger(error, checker.name);
      }

      return {
        status: HealthStatus.UNHEALTHY,
        debug: { error }
      };
    }
  }

  /**
   * Starts the background check if it's not already running
   */
  #handleBackgroundCheck() {
    if (
      // already called
      this.backgroundCheckIntervalId ||
      // no interval set
      !this.options.backgroundCheckInterval
    ) {
      return;
    }

    this.backgroundCheckIntervalId = setInterval(
      this.performCheck,
      this.options.backgroundCheckInterval
    );

    if (!this.options.manualClearBackgroundCheck) {
      closeWithGrace(
        {
          delay: 500,
          logger: this.options.errorLogger ? { error: this.options.errorLogger } : undefined
        },
        this.closeBackgroundCheck
      );
    }
  }

  /**
   * Stops the background check if it's running
   */
  readonly closeBackgroundCheck = (): void => {
    if (this.backgroundCheckIntervalId) {
      clearInterval(this.backgroundCheckIntervalId);
      this.backgroundCheckIntervalId = null;
    }
  };

  /** to be used as `using medicus = new Medicus()` */
  [Symbol.dispose]() {
    this.closeBackgroundCheck();
  }
}

import { Type } from '@sinclair/typebox';
import { HealthStatus } from './types';

export const HealthStatusSchema = Type.Enum(HealthStatus, {
  $id: 'MedicusHealthStatus'
});

export const DetailedHealthCheckSchema = Type.Object(
  {
    status: Type.Ref(HealthStatusSchema),
    debug: Type.Optional(
      Type.Record(Type.String(), Type.Union([Type.Number(), Type.Boolean(), Type.String()]))
    )
  },
  {
    $id: 'MedicusDetailedHealthCheck',
    additionalProperties: false
  }
);

export const HealthCheckResultSchema = Type.Object(
  {
    status: Type.Ref(HealthStatusSchema),
    services: Type.Record(Type.String(), Type.Ref(DetailedHealthCheckSchema))
  },
  {
    $id: 'MedicusHealthCheckResult',
    additionalProperties: false
  }
);

export const HealthCheckQueryParamsSchema = Type.Object(
  {
    last: Type.Optional(
      Type.Boolean({
        description: 'If set to true, the last health check result will be returned'
      })
    )
  },
  {
    $id: 'MedicusHealthCheckQueryParams',
    additionalProperties: false
  }
);

/**
 * An array containing all schemas to be easily added to a JSON schema validator
 */
export const AllSchemas = [
  DetailedHealthCheckSchema,
  HealthCheckResultSchema,
  HealthCheckQueryParamsSchema,
  HealthStatusSchema
];
